import React, { useEffect } from "react"; // Combine React and useEffect in a single import
import { useNavigate, Link } from "react-router-dom";

export default function Dashboard() {
  const navigate = useNavigate();

  useEffect(() => {
    // Check if UserID is stored in localStorage (i.e., the user is logged in)
    const userId = localStorage.getItem("userId");

    if (!userId) {
      // Redirect to login if no UserID found
      navigate("/login");
    }
  }, [navigate]);


    return (
      <div>
        <center>
         <h2>Dashboard</h2>
        </center>
      </div>
    )
  }
